import { Injectable } from '@angular/core';
import {
  HttpClient,
  HttpHeaders,
  HttpParams,
  HttpErrorResponse,
} from '@angular/common/http';

import { Apis } from '../utils/apis';
import { GlobalData } from '../utils/data';

@Injectable({
  providedIn: 'root',
})
export class AuthService {
  public login: boolean = true;
  public userData: any;

  public token: string =
    'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6ImFkbWluQGdtYWlsLmNvbSIsImFkbWluIjp0cnVlLCJpYXQiOjE2NzcxMzAzOTksImV4cCI6MTcwODIzNDM5OX0.b9UyeCZyMzw1tzsbKy0T8-l-NmbemJOL-mOLBGn2-Ck';
  bearerToken: string = 'bearer' + ' ' + this.token;

  public headers: any = new HttpHeaders({
    'Content-Type': 'application/json; charset=utf-8',
    Authorization: this.bearerToken,
  });

  url = 'http://localhost:5000/user/?email=admin@gmail.com';

  constructor(private http: HttpClient) {}

  login(){
    this.http.post(Apis.login).subscribe()
  }

  getUser() {
    this.http
      .get(this.url, { headers: { Authorization: this.bearerToken } })
      .subscribe((res) => {
        console.log(res);
        this.userData = res;
      });
  }


}
